import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Set mobile viewport to trigger mobile layout
    await page.setViewportSize({ width: 375, height: 667 });

    // Navigate to the HTML file with load wait instead of networkidle
    await page.goto(fileUrl, { waitUntil: 'load' });

    // Wait for critical elements to be present
    await page.waitForSelector('.nav-menu');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open mobile menu
    await page.click('.nav-menu');
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });

    // Take screenshot of open menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_menu_open.png'));

    // Verify menu items are present
    const menuItems = await page.$$eval('.mobile-menu a', items => 
      items.map(item => item.textContent.trim())
    );

    // Click on a menu item (Electronics)
    await page.click('text=Electronics');

    // Wait for menu to close
    await page.waitForSelector('#mobileMenuOverlay:not(.show)', { timeout: 5000 });

    // Take final screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_navigation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_navigation.png'));

    return {
      success: true,
      action: "Successfully tested mobile menu navigation - opened menu, verified items, and navigated to Electronics",
      extractedData: {
        menuItems: menuItems,
        menuItemsCount: menuItems.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
